	//	                                          - example with 2 metadata keys: searching by
	//	                                                    `{
	//	                                                    `  "data": {
	//	                                                    `    "metadata": {
	//	                                                    `      "fields": {
	//	                                                    `        "foo1": {
	//	                                                    `          "string_value": "bar2"
	//	                                                    `        },
	//	                                                    `        "foo2": {
	//	                                                    `          "string_value": "bar2"
	//	                                                    `        }
	//	                                                    `      }
	//	                                                    `    }
	//	                                                    `  }
	//	                                                    `}
	//	                                                    will result in a search condition like `(metadata includes {"foo1": "bar1"}) OR (metadata includes {"foo2": "bar2"})`.
